#include <stdio.h>
#include <string.h>

#include <cnn.h>
#include <cnn_private.h>
#include <cnn_calc.h>

#define KERNEL_SIZE 3
#define IMG_WIDTH 32
#define IMG_HEIGHT 32

#define OUTPUTS 10
#define DATA_AMOUNT 100
#define ITER 10000

#define test(func) \
	ret = func; \
	if(ret < 0) \
	{ \
		printf("%s failed with error: %d\n", #func, ret); \
		return -1; \
	}

extern float dataset[];

int main()
{
	int iter;
	int i, j;
	int ret;
	int dataCols;
	float mse;

	cnn_config_t cfg = NULL;
	cnn_t cnn = NULL;

	float output[OUTPUTS];
	float err[OUTPUTS];

	// Set config
	test(cnn_config_create(&cfg));
	test(cnn_config_set_input_size(cfg, IMG_WIDTH, IMG_HEIGHT));
	test(cnn_config_set_layers(cfg, 8));

	test(cnn_config_set_convolution(cfg, 1, 2, 3));
	test(cnn_config_set_activation(cfg, 2, CNN_RELU));
	test(cnn_config_set_convolution(cfg, 3, 2, 3));
	test(cnn_config_set_activation(cfg, 4, CNN_RELU));
	test(cnn_config_set_full_connect(cfg, 5, 128));
	test(cnn_config_set_full_connect(cfg, 6, OUTPUTS));
	test(cnn_config_set_activation(cfg, 7, CNN_SOFTMAX));

	// Create cnn
	test(cnn_create(&cnn, cfg));
	cnn_rand_network(cnn);

	// Training
	dataCols = IMG_WIDTH * IMG_HEIGHT + OUTPUTS;
	for(iter = 0; iter < ITER; iter++)
	{
		mse = 0;

		for(i = 0; i < DATA_AMOUNT; i++)
		{
			test(cnn_training_custom(cnn, 0.001,
						&dataset[i * dataCols],
						&dataset[i * dataCols + IMG_WIDTH * IMG_HEIGHT],
						output, err));

			for(j = 0; j < OUTPUTS; j++)
			{
				mse += err[j] * err[j];
			}
		}

		mse /= (float)(OUTPUTS * DATA_AMOUNT);
		printf("Iter %d, mse: %f\n", iter, mse);
	}

	return 0;
}

